import './App.css';
import {BrowserRouter as Router, Route} from 'react-router-dom'
import Nav from './components/Nav'
import Menu from './components/Menu'
function App() {
  return (
    <div className="App">
      <Router>
        <Route  path='/' component={Nav}/>
        <Route exact path='/menu' component={Menu}/>
      </Router>
    </div>
  );
}

export default App;
